import React, { useState } from "react";
import { Link, useMatch, useNavigate } from "react-router-dom";
import { motion } from "framer-motion";
import styled from "styled-components";

const Container = styled.div`
  width: 100%;
  height: 180px;
  position: fixed;
`;

const GameList = styled.div`
  width: 100%;
  height: 110px;
  background: var(--gray1);
`;

const Nav = styled.div`
  width: 100%;
  height: 70px;
  padding: 0 5%;
  position: relative;
  background: var(--main);
`;

const Logo = styled.svg`
  width: 130px;
  height: 40px;
  top: 50%;
  cursor: pointer;
  position: absolute;
  transform: translateY(-50%);
`;

const Items = styled.div`
  position: absolute;
  display: flex;
  justify-content: center;
  left: 50%;
  top: 50%;
  transform: translate(-50%, -50%);
  gap: 50px;
`;

const Item = styled.div`
  font-weight: 600;
  font-family: var(--Figtree);
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  position: relative;
`;

const Line = styled(motion.span)`
  width: 48px;
  height: 6px;
  left: 0;
  right: 0;
  bottom: -27px;
  margin: 0 auto;
  background: var(--dark);
  position: absolute;
`;

const Profile = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  position: absolute;
  right: 96px;
  gap: 16px;
  top: 50%;
  transform: translateY(-50%);
`;

const Emblem = styled.svg`
  width: 50px;
`;

const UserName = styled.p`
  font-weight: bold;
  font-family: var(--Pretendard);
`;

const User = styled.div`
  width: 260px;
  height: 300px;
  border-radius: 8px;
  border: 1px solid var(--gray6);
  background: var(--light);
  box-shadow: 0px 1px 10px 0px rgba(0, 0, 0, 0.1);
  right: -3%;
  top: 90%;
  position: absolute;
  display: ${(props) => (props.isOpen ? "block" : "none")};
`;

const InfoBtn = styled.i`
  margin-left: 16px;
  cursor: pointer;
`;
const UserInfo = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  gap: 16px;
  padding: 30px 35px;
`;

const UserDesc = styled.div`
  width: 110px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: start;
  gap: 8px;
`;

const UserId = styled.p`
  font-size: 2rem;
`;

const SelectTeam = styled.span`
  font-size: 1.2rem;
  font-weight: 400;
`;

const UserTeam = styled.svg`
  width: 60px;
  height: 60px;
  background: #0066b3;
  border-radius: 6px;
`;

const Gnb = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: flex-start;
  gap: 25px;
  padding: 26px 35px;
`;

